import '../styles/Menu.css';

function Menu() {
  return (
    <div className="Menu">
      
        
          <Select
        data={myData}
        display="inline"
        touchUi={false}
    />
        <p>
          Info
        </p>
        <p>
          Dataset
        </p>
      
    </div>
  );
}

export default Menu;
